import { Story } from "@storybook/react";

import { ToDoItems, ToDoItemsProps } from "./ToDoItems";
import { ToDoModal, ToDoModalProps } from "./ToDoModal";

export default {
  title: "Components/ToDo Items",
  component: ToDoItems,
};

type _Task = ToDoModalProps["task"];

const Template: Story<{ tasks: ToDoItemsProps["tasks"] }> = (args) => {
  const [tasks, setTasks] = React.useState<Record<string, _Task>>({});

  const _tasks = React.useMemo(() => {
    return args.tasks
      .map((task) => ({ ...task, ...tasks[task.id] }))
      .filter((t) => !t.completed);
  }, [tasks, args.tasks]);

  return (
    <ToDoItems
      tasks={_tasks}
      onToDoItemChange={(task, completed) => {
        setTasks((tasks) => ({
          ...tasks,
          [task.id]: { ...task, completed },
        }));
      }}
    />
  );
};

export const Simple = Template.bind({});
Simple.args = {
  tasks: [
    {
      id: "1",
      title: "Hello world 1",
      details: "Some details about the task",
      completed: false,
    },
    {
      id: "2",
      title: "Hello world 2",
      details: "Some details about the task",
      completed: false,
    },
    {
      id: "3",
      title: "Hello world 3",
      details: "Some details about the task",
      completed: false,
    },
  ],
};
